import React from "react";
import { Card } from "antd";

const Meta = Card;

const ProjectCard = ({ coverSrc, title, description, overlay }) => (
  <Card
    style={{ width: 240 }}
    hoverable
    bordered={false}
    cover={<img src={coverSrc} alt={title} />}
  >
    <Meta title={title} description={description} />
  </Card>
);

export default ProjectCard;
